    "northwest-montana-wetland-management-district-annual-narrative-report-calendar-year-1979",nt"isopen":
    false,nt"url": null,nt"notes": "This annual narrative report for Northwest
    Montana Wetland Management District outlines Refuge accomplishments during the 1979
    calendar year. The report begins with an introduction to the Refuge and describes
    climate and habitat conditions, land acquisition, and system status. Refuge construction
    and maintenance is also described. Habitat management is covered; croplands, grasslands,
    and wetlands are discussed. The wildlife section of the report discusses endangered
    and threatened species, migratory birds, mammals, and big game animals. Interpretation
    and recreation activities are outlined; topics include information and interpretation,
    recreational uses, and law enforcement. Field investigations,  items of interest,
    and safety are discussed. Photographs are attached.",nt"license_title": "License
